import { GoogleMap , withScriptjs , withGoogleMap , Marker} from 'react-google-maps';

const mapMarkers = [
    {
        key : 1,
        position : {lat : 46.753350 , lng : 23.576040},
    },
    {
        key : 2,
        position : {lat : 46.783280 , lng : 23.631000},
    },
    {
        key : 3,
        position : {lat : 46.750930 , lng : 23.596210},
    },
    {
        key : 4,
        position : {lat : 46.770910 , lng : 23.593310},
    },
    {
        key : 5,
        position : {lat : 46.767700 , lng : 23.624330},
    },
]

export default mapMarkers;
